description:
điểm nổi bật:
- ngõ 89 lạc long quân rộng rãi, đi lại thuận tiện, có chỗ để ô tô gần nhà;
- xây dựng 5 tầng khung cột bê tông kiên cố, chắc chắn;
- đường trước nhà rộng 3 mét, khá yên tĩnh, thoáng mát;
_vị trí: nằm cách mặt đường lạc long quân không xa. đường trước nhà trải nhựa, rộng rãi. gần nhà có nhiều bãi để ô tô, đi bộ gần, rất thuận tiện.
_pháp lý: sổ đỏ chính chủ, không quy hoạch, không tranh chấp. pháp lý chuẩn.
_chất lượng xây dựng: nhà xây 5 tầng, 3 phòng ngủ, có phòng thờ và sân phơi.
mua bán chính chủ. 
sơn thổ - chuyên nghiên cứu & định giá bđs hà nội
./.
